import React, { useState, useEffect } from 'react';
import {
  Container,
  Row,
  Col,
  ToggleButton,
  ToggleButtonGroup,
  Card,
} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// New pricing model: price per kg
const pricePerKg = {
  '세럼/앰플': 40000, // 1kg당 40,000원
  '크림': 50000,      // 1kg당 50,000원 (가정)
};

const App = () => {
  const [product, setProduct] = useState(null);
  const [volume, setVolume] = useState(null);
  const [quantity, setQuantity] = useState(null);
  const [estimate, setEstimate] = useState(0);
  const [unitPrice, setUnitPrice] = useState(0);

  const productOptions = ['세럼/앰플', '크림'];
  const volumeOptions = ['50ml', '100ml', '150ml'];
  const quantityOptions = [1000, 3000, 5000];

  useEffect(() => {
    if (product && volume && quantity) {
      const basePrice = pricePerKg[product];
      // 1ml = 1g 가정하여 계산
      const weightInGrams = parseInt(volume.replace('ml', ''));
      const weightInKg = weightInGrams / 1000;

      const calculatedUnitPrice = basePrice * weightInKg;
      const totalEstimate = calculatedUnitPrice * quantity;

      setUnitPrice(calculatedUnitPrice);
      setEstimate(totalEstimate);

    } else {
      setUnitPrice(0);
      setEstimate(0);
    }
  }, [product, volume, quantity]);

  const formatPrice = (price) => {
      return price > 0 ? `${Math.round(price).toLocaleString()}원` : '';
  }

  return (
    <Container className="mt-5">
      <Card className="glass-card">
        <Card.Header as="h2">화장품 생산 견적</Card.Header>
        <Card.Body>
          {/* Option Selection */}
          <Row className="mb-3">
            <Col>
              <h5>제품군</h5>
              <ToggleButtonGroup type="radio" name="product-options" value={product} onChange={setProduct}>
                {productOptions.map((p) => (
                  <ToggleButton key={p} id={`product-${p}`} value={p} variant="outline-primary">
                    {p}
                  </ToggleButton>
                ))}
              </ToggleButtonGroup>
            </Col>
          </Row>

          <Row className="mb-3">
            <Col>
              <h5>용량</h5>
              <ToggleButtonGroup type="radio" name="volume-options" value={volume} onChange={setVolume}>
                {volumeOptions.map((v) => (
                  <ToggleButton key={v} id={`volume-${v}`} value={v} variant="outline-primary">
                    {v}
                  </ToggleButton>
                ))}
              </ToggleButtonGroup>
            </Col>
          </Row>

          <Row className="mb-4">
            <Col>
              <h5>수량</h5>
              <ToggleButtonGroup type="radio" name="quantity-options" value={quantity} onChange={setQuantity}>
                {quantityOptions.map((q) => (
                  <ToggleButton key={q} id={`quantity-${q}`} value={q} variant="outline-primary">
                    {q}개
                  </ToggleButton>
                ))}
              </ToggleButtonGroup>
            </Col>
          </Row>

          {/* Estimation Result */}
          <Row>
            <Col>
                {estimate > 0 ? (
                    <div>
                        <p style={{fontSize: '1.1rem', margin: '0'}}>개당 예상 가격: {formatPrice(unitPrice)}</p>
                        <h4 className="mt-2">총 예상 견적: {formatPrice(estimate)}</h4>
                    </div>
                ) : (
                    <h4>옵션을 모두 선택해주세요.</h4>
                )}
            </Col>
          </Row>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default App;
